import React from "react";
import "./style.css";
var Shuffle = require("react-shuffle");



const App = React.createClass({
  render() {
    return (
      <Shuffle>
       <img className="image" alt={props.name} src={props.image} onClick={this.handleIncrement}/>
      </Shuffle>
    )
  }
});

  function CharacterCard(props) {
    render();
    return (
          <Shuffle>
            <img className="image" alt={props.name} src={props.image} onClick={this.handleIncrement}/>
          </Shuffle>
    )
  }

export default CharacterCard;
